import PropTypes from 'prop-types'
import Square from './Square'

const Board = (props) => {
	return(
		<header>
			<h1> {props.title}</h1>
			<Square color = 'green'/>
		</header>
	)
}

Board.defaultProps = {
	title: 'Connect4',
}

Board.propTypes = {
	title : PropTypes.string,
}

export default Board
